import React from "react";
import UserProvider from "./store/providers/UserProvider";

import Home from "./components/Home";
import RegisterForm from "./components/RegisterForm";
import LoginForm from "./components/LoginForm";
import "./App.css";

const App = () => {
  return (
    <div>
      <UserProvider>
        <Home />
        <RegisterForm />
        <LoginForm />
      </UserProvider>
    </div>
  );
};

export default App;
